import React from "react";
import PropTypes from 'prop-types'

Border.propTypes = {
    refProp: PropTypes.func,
}

Border.defaultProps = {
    refProp: null
}

function Border({ borderColor = "", my = "20" }, props) {
    return (
        <div ref={props.refProp}>
            <div
                className={`border-t-2 w-2/3 my-8 my-${my} mx-auto ${borderColor}`}
            ></div>
        </div>

    );
}

export default Border;
